def two_sum(numbers, target):
    left, right = 0, len(numbers) - 1  # Initialize two pointers
    while left < right:
        s = numbers[left] + numbers[right]
        if s == target:
            return [left + 1, right + 1]  # We return 1-indexed indices
        elif s > target:
            right -= 1  # Move the right pointer left
        else:
            left += 1  # Move the left pointer right
    return []
